import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Link, useNavigate } from 'react-router-dom';
import Register from './Register';
import Login from './Login';
import AttendanceForm from './AttendanceForm';
import AttendanceDashboard from './AttendanceDashboard';
import Dashboard from './Dashboard';
import './App.css';

function AppContent() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    const userData = localStorage.getItem('user');

    if (token && userData) {
      setIsAuthenticated(true);
      setUser(JSON.parse(userData));
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    setIsAuthenticated(false);
    setUser(null);
    navigate('/login');
  };

  if (!isAuthenticated) {
    return (
      <Routes>
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <Route path="/" element={<Navigate to="/login" />} />
        <Route path="*" element={<Navigate to="/login" />} />
      </Routes>
    );
  }

  return (
    <>
      {/* Header */}
      <header className="app-header">
        <div className="header-content">
          <h1>Employee Attendance Tracker</h1>
          <div className="user-info">
            <span>Welcome, {user?.employeeName} ({user?.employeeID})</span>
            <button onClick={handleLogout} className="logout-btn">
              Logout
            </button>
          </div>
        </div>

        {/* Navigation Bar */}
        <nav className="nav-bar">
          <Link to="/dashboard" className="nav-link">Dashboard</Link>
          <Link to="/mark" className="nav-link">Mark Attendance</Link>
          <Link to="/records" className="nav-link">View Records</Link>
        </nav>
      </header>

      {/* Main Routes */}
      <main className="main-content">
        <Routes>
          <Route path="/dashboard" element={<Dashboard user={user} onLogout={handleLogout} />} />
          <Route path="/mark" element={<AttendanceForm />} />
          <Route path="/records" element={<AttendanceDashboard />} />
          <Route path="*" element={<Navigate to="/dashboard" />} />
        </Routes>
      </main>
    </>
  );
}

function App() {
  return (
    <Router>
      <div className="App">
        <AppContent />
        <footer className="app-footer">
          <div className="footer-content">
            <p>&copy; 2025 Employee Attendance Tracker</p>
          </div>
        </footer>
      </div>
    </Router>
  );
}

export default App;
